import React from 'react';
import './App.css';
import Header from './components/Header';
import MovieList from './components/MovieList';
import data from './data';

function App() {
  return (
    <body className='body'>
      <section className="App">
        <Header />
        <MovieList className='page-title' movies={ data } />
      </section>
    </body>
  );
}

export default App;
